import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import NavBar from '../components/NavBar';
import Post from '../components/Post';
import '../assets/styles/Main.css';

const examplePost = {
  username: 'John Doe',
  time: '2 hours ago',
  content: 'This is an example post content to demonstrate the post layout. It can include text, images, and other media.'
};

const MainPage = () => (
  <div className="main-page">
    <Header />
    <div className="content">
      <div className="sidebar">
        <NavBar />
      </div>
      <div className="main-content">
        <div className="post-creation">
          <div className="profile-picture"></div>
          <textarea placeholder="What's Happening?"></textarea>
          <div className="location-and-image">
            <input type="text" placeholder="Want to add Location?" />
            <div className="image-upload">
              <span>+</span>
            </div>
          </div>
          <button className="post-button">Post</button>
        </div>
        <Post post={examplePost} />
        <Post post={examplePost} />
        <Post post={examplePost} />

      </div>
    </div>
    <Footer />
  </div>
);

export default MainPage;
